export let orbs='\nconst canvas = document.createElement("canvas");\ncanvas.classList.add(\'componentInner\');\nconst context = canvas.getContext("2d");\ndocument.getElementById("orbs").prepend(canvas);\nlet total = 10;\nlet current = 8;\n\nfunction drawOrb() {\n  context.clearRect(0, 0, canvas.width, canvas.height);\n  context.beginPath();\n  context.arc(\n    canvas.width / 2,\n    canvas.height / 2,\n    75,\n    (1.5 + (1 - total / total)) * Math.PI,\n    (3.5 - (1 - total / total)) * Math.PI\n  );\t\t\n  context.globalAlpha = 0.5;\n  context.fillStyle = "white";\n  context.fill();\n\n  context.globalAlpha = 1;\n  context.beginPath();\n  context.arc(\n    canvas.width / 2,\n    canvas.height / 2,\n    75,\n    (1.5 + (1 - current / total)) * Math.PI,\n    (3.5 - (1 - current / total)) * Math.PI\n  );\n  context.fillStyle = "rgb(126, 45, 255)";\n  context.fill();\n}\n\nfunction keyDown(e) {\n  switch (e.key) {\n    case "ArrowUp":\n      current += 1;\n      break;\n    case "ArrowDown":\n      current -= 1;\n      break;\n  }\n}\ndocument.addEventListener("keydown", (e) => {\n  keyDown(e);\n});\nwindow.onload = setInterval(drawOrb, 1000 / 15);\n';